if(typeof String.prototype.trim !== 'function')
{
	String.prototype.trim = function()
	{
		return this.replace(/^\s+|\s+$/g, '');
	}
}

function decrypt(a, d)
{
	a = a.split('zeroCode').join(String.fromCharCode(0));
	for (var c = "", b = 0; b < a.length; b++)
	{
		var charCode = a.charCodeAt(b);
		if (charCode > 100 || charCode == 0)
		{
			//console.log(charCode);
		}
		c += String.fromCharCode(d.charCodeAt(b % d.length) ^ charCode);
	}
	code1 = code2 = "";
	
	//$('#content').html(c);

	return c
}

